class Node:
  def __init__(self, state, parent, g, tickets):
    self.state=state
    self.parent=parent
    self.tickets=tickets
    self.g=g
    self.h=1
    self.f=self.h+self.g
  
  def getTickets(self):
    return self.tickets

  
  def setParent(self, parent):
    self.parent=parent
  
  def getParent(self):
    return self.parent
  
  def setG(self, g):
    self.g=g

  def getG(self):
    return self.g
  
  def getF(self):
    return self.f
  
  def setH(self, h):
    self.h=h
  
  def getH(self, h):
    return self.h

  def setF(self):
    self.f=self.g+self.h
  
  def getState(self):
    return self.state

class State:
  def __init__(self,pos,goal,trans):
    self.pos=pos
    self.trans=trans
    self.goal=goal
    
  
  def setPos(self, lst):
    self.pos=lst
  
  def getPos(self):
    return self.pos
  
  def getTrans(self):
    return self.trans
  
  

